INSERT INTO `competence_tests_emailitem` VALUES (1,'Phishing/Mailsystem/Impuls1','lukas.maier2000@gmail.com','Christian Müller','Angebot für 2022','Hallo, hier ist das Dokument, nach dem Sie gefragt haben. Melden Sie sich bitte, falls Sie noch Fragen haben.\r\nLukas Müller hat einen Link freigegeben:\r\n\r\n<a href=\"#\" style=\"color: #007bff; text-decoration: underline;\">http://www1.drive-google.ru/lukas.maier/angebot/</a>\r\n\r\nViele Grüße\r\nLukas Maier\r\nArneo GmbH','static/images/Screenshot_2022-10-24_at_22.22.21.png','20:13:46.000000','Hallo, hier ist das Dokument, nach dem Sie gefragt haben. Melden Sie sich bitte, falls Sie noch Fragen haben.\r\nLukas Müller hat einen Link freigegeben:',''),(2,'Phishing/Mailsystem/Impuls2','christian.schlosser22@gmail.com','Christian Müller','Deine Angestelltenakte','Hallo, Herr Müller, nicht wundern, ich habe Probleme mit unserem Firmenpostfach. Ich aktualisiere Ihre Angestelltenakte und muss sicherstellen, dass Ihr Geburtsdatum und Ihre Wohnadresse noch aktuell sind.\r\nKönnen Sie mir das so schnell wie möglich zukommen lassen?\r\n\r\nFreundliche Grüße\r\nChristina Schlosser\r\nHuman Resources Department\r\nchristina.schlosser@arneo.com','static/images/Screenshot_2022-10-24_at_22.23.00.png','20:31:14.000000','Hallo, Herr Müller, nicht wundern, ich habe Probleme mit unserem Firmenpostfach. Ich aktualisiere Ihre Angestelltenakte und muss sicherstellen, dass Ihr Geburtsdatum und Ihre Wohnadresse noch aktuell sind.',NULL),(3,'Phishing/Mailsystem/Impuls3','mark.kistner@arneo.com','Christian Müller','Telefonnummer','Hi, kannst du mir bitte deine private Nummer schicken - ich möchte dich um einen Gefallen bitten.','static/images/Screenshot_2022-10-24_at_22.22.21_KVvyYcq.png','20:32:29.000000','Hi, kannst du mir bitte deine private Nummer schicken - ich möchte dich um einen Gefallen bitten.',NULL),(4,'Malware/Mailsystem/Impuls1','anna.brand@gmail.com','Sven Müller','Plankosten','Guten Tag, \r\n\r\nanbei finden Sie die vorläufigen Plankosten 2022 zur Prüfung. \r\n\r\nBitte melden Sie sich unmittelbar, wenn Korrekturen vorgenommen werden sollen. \r\n\r\n<a href=\"#\" style=\"color: #007bff; text-decoration: underline;\">http://personal.pt/t/f8k5talbrxxe/Plankosten2022.xlsx</a>\r\n\r\nDanke und viele Grüße\r\nAnna Brand\r\nAbteilung Buchhaltung & Finanzen\r\nanna.brand@arneo.com','','14:16:09.000000','Guten Tag, anbei finden Sie die vorläufigen Plankosten 2022 zur Prüfung. Bitte melden Sie sich unmittelbar, wenn Korrekturen vorgenommen werden sollen.',''),(5,'Malware/Mailsystem/Impuls2','denise.miller@gmail.com','Sven Müller','Updated INV# 312821','Hello,\r\nPlease see the attached invoice.\r\n\r\n<a href=\"#\" style=\"color: #007bff; text-decoration: underline;\">http://www1.drive-google.com/denise.miller8328/INV312821.html</a>\r\n\r\nDenise Miller','','14:17:35.000000','Hello,\r\nPlease see the attached invoice.',''),(6,'Malware/Mailsystem/Impuls3','anna.brand@arneo.com','Sven Müller','Nutzung dienstliche E-Mail','Guten Tag, \r\n\r\ndamit kostbare Ressourcen geschont werden, soll in allen Arbeitsbereichen der Einsatz von Papierausdrucken reduziert werden. \r\nDer Informationsaustausch in elektronischer Form wird daher weiter ausgebaut. Weitere Informationen entnehmen Sie bitte folgendem PDF-Dokument: \r\n\r\n<a href=\"#\" style=\"color: #007bff; text-decoration: underline;\">https://mydocs.xtech.com/sites/281/Informationen_zu_Papierausdruck.pdf</a>\r\n\r\nMit freundlichen Grüßen\r\nIhre Abteilung Buchhaltung & Finanzen','','14:18:31.000000','Guten Tag, damit kostbare Ressourcen geschont werden, soll in allen Arbeitsbereichen der Einsatz von Papierausdrucken reduziert werden',''),(7,'SA/Malware/Mailsystem/Impuls1','sven.mueller@gmail.com','Sebastian Schmidt','Ausstellungsmessen für die smarten Ventilatoren','Guten Tag, anbei finden Sie die die weiteren Ausstellungsmessen, auf denen wir unsere smarten Ventilatoren präsentieren und Kunden akquirieren können. Bitte melden Sie sich unmittelbar, wenn Sie auf eine der genannten Messen nicht vor Ort sein können.\r\n\r\n<a href=\"#\" style=\"color: #007bff; text-decoration: underline;\">http://personal.pt/t/f8k5talbrxxe/Austellungsmessen2022.xlsx</a>\r\n\r\nDanke und viele Grüße\r\nSven Müller\r\nAbteilung Vertrieb & Marketing\r\nsven.mueller@arneo.com','','14:24:08.000000','Guten Tag, anbei finden Sie die die weiteren Ausstellungsmessen, auf denen wir unsere smarten Ventilatoren präsentieren und Kunden akquirieren können. Bitte melden Sie sich unmittelbar, wenn Sie auf eine der genannten Messen nicht vor Ort sein können.',''),(8,'SA/Malware/Mailsystem/Impuls2','denise.miller@gmail.com','Sebastian Schmidt','Updated INV# 312821','Hello,\r\nPlease see the attached invoice.\r\n\r\n<a href=\"#\" style=\"color: #007bff; text-decoration: underline;\">http://www1.drive-google.com/denise.miller8328/INV312821.html</a>\r\n\r\nDenise Miller','','14:25:14.000000','Hello,\r\nPlease see the attached invoice.',''),(9,'SA/Malware/Mailsystem/Impuls3','anna.brand@arneo.com','Sebastian Schmidt','Nutzung dienstliche E-Mail','Guten Tag, damit kostbare Ressourcen geschont werden, soll in allen Arbeitsbereichen der Einsatz von Papierausdrucken reduziert werden. Der Informationsaustausch in elektronischer Form wird daher weiter ausgebaut. Weitere Informationen entnehmen Sie bitte folgendem PDF-Dokument: \r\n\r\n<a href=\"#\" style=\"color: #007bff; text-decoration: underline;\">https://mydocs.xtech.com/sites/281/Informationen_zu_Papierausdruck.pdf</a>\r\n\r\nMit freundlichen Grüßen\r\nIhre Abteilung Buchhaltung & Finanzen','','14:26:09.000000','Guten Tag, damit kostbare Ressourcen geschont werden, soll in allen Arbeitsbereichen der Einsatz von Papierausdrucken reduziert werden. Der Informationsaustausch in elektronischer Form wird daher weiter ausgebaut.',''),(10,'FK/Phishing/Mailsystem/Impuls 2','f.schuhmann@gmx.de','Frau Blitz','Apero Einladung','Hallo Frau Blitz,\r\nvielen Dank für die gute Zusammenarbeit in den letzten Monaten. Das Projekt \"Smarte Ventilatoren\" war ein voller Erfolg, weshalb ich gerne im Anschluss des nächsten Meetings zu einem Apéro einladen möchte.\r\n\r\nZur Terminplanung bitte hier klicken: <a href=\"#\" style=\"color: #007bff; text-decoration: underline;\">https://terminplaner.dfn.de//NSD(BSAm2qnleyayNIP</a>\r\n\r\nMit den besten Grüßen\r\nFabian Schuhmann \r\nGeschäftsführer \r\nfabian.schuhmann@arneo.com','','06:00:00.000000','Hallo Frau Blitz,\r\nvielen Dank für die gute Zusammenarbeit in den letzten Monaten. Das Projekt \"Smarte Ventilatoren\" war ein voller Erfolg, weshalb ich gerne im Anschluss des nächsten Meetings zu einem Apéro einladen möchte.',''),(11,'FK/Phishing/Mailsystem/Impuls 3','fabian.schuhmann@arneo.com','Du','Präsentation der Verkaufszahlen','Liebes Projektteam, \r\nvielen Dank für die gute Zusammenarbeit in den letzten Monaten. Das Projekt \"Smarte Ventilatoren\" war ein voller Erfolg, weshalb ich Ihnen gerne im nächsten Meeeting die Verkaufszahlen präsentieren möchte. \r\nIch danke Ihnen im Namen der ganzen Arneo GmbH für Ihren Einsatz!\r\n\r\nMit den besten Grüßen \r\nFabian Schuhmann \r\nGeschäftsführer\r\nfabian.schuhmann@arneo.com','','14:37:58.000000','Liebes Projektteam, \r\nvielen Dank für die gute Zusammenarbeit in den letzten Monaten. Das Projekt \"Smarte Ventilatoren\" war ein voller Erfolg, weshalb ich Ihnen gerne im nächsten Meeeting die Verkaufszahlen präsentieren möchte.',NULL),(12,'FK/Phishing/Mailsystem/Impuls 1','fabian.schuhmann@gmx.ru','Frau Blitz','Erfolgreiches Projekt','Hallo Frau Blitz, \r\nvielen Dank für die gute Zusammenarbeit in den letzten Monaten. Das Projekt \"Smarte Ventilatoren\" war ein voller Erfolg, weshalb ich Ihnen gerne die Verkaufszahlen präsentieren möchte. \r\nHierzu klicken Sie bitte auf den folgenden Link. \r\n\r\n<a href=\"#\" style=\"color: #007bff; text-decoration: underline;\">http://www1.drive-google.ru/arneogmbh/verkaufszahlen/</a>\r\n\r\nMit den besten Grüßen \r\nFabian Schuhmann \r\nGeschäftsführer \r\nfabian.schuhmann@arneo.com','','14:43:37.000000','Hallo Frau Blitz, \r\nvielen Dank für die gute Zusammenarbeit in den letzten Monaten. Das Projekt \"Smarte Ventilatoren\" war ein voller Erfolg, weshalb ich Ihnen gerne die Verkaufszahlen präsentieren möchte.',''),(13,'Privat/Phishing/Mailsystem/Impuls1','SparkasseMitteilung@gmail.com','Mike Bauer','Mitteilung Ihrer Sparkasse','Sehr geehrte*r Kund*in,\r\nDurch die neuen Änderungen des Bundes sind wir die Kreditinstitute dazu verpflichtet in regelmäßigen Abständen Informationen unserer Sparkassen-Kunden zu überprüfen.\r\n\r\nWir als Ihr Kreditinstitut haben die neuen Gesetze umgesetzt.\r\n\r\nMit dem Verfahren können unsere Kunden Ihre Informationen für die Legitimation ganz einfach durchführen.\r\nAnschließend werden die von Ihnen eingetragenen Informationen an einen unserer Kundenbetreuer übermittelt und vervollständigt.\r\n\r\nDie Überprüfung muss bis zum 20.7.2023 abgeschlossen werden. Wir bitten Sie daher diese Legitimation schnellst-möglich zu vervollständigen. Andernfalls werden wichtige Funktionen Ihres Giro-Kontos für eine bestimmte Zeit eingeschränkt.\r\n\r\n<Zur Bestätigung>\r\n\r\nWir bedanken uns für Ihre Aufmerksamkeit.\r\nViele Grüße, Ihre Sparkasse','','15:26:37.000000','Sehr geehrte*r Kund*in,\r\nDurch die neuen Änderungen des Bundes sind wir die Kreditinstitute dazu verpflichtet in regelmäßigen Abständen Informationen unserer Sparkassen-Kunden zu überprüfen.',NULL),(14,'Privat/Phishing/Mailsystem/Impuls2','SparkasseMitteilung@gmail.com','Mike Bauer','Ihre Zustimmung ist gefragt!','Sehr geehrter Herr Bauer,\r\ndamit wir unsere gemeinsame Geschäftsverbindung fortführen können, benötigen wir als Sparkasse dringend Ihre aktive Zustimmung.\r\n\r\nEinen ausführlichen Brief inkl. der Bedingungen finden Sie in Ihrem Online-Banking.\r\n\r\nSie können uns ganz einfach Ihr Einverständnis mit einer Antwort auf diese E-Mail geben. Dazu schreiben Sie bitte in Ihre Antwort Ihren Anmeldenamen sowie Ihr Passwort von Ihrem Online-Banking-Zugang.\r\n\r\nWir bedanken uns für Ihre Aufmerksamkeit.\r\nViele Grüße, Ihre Sparkasse','','15:26:37.000000','Sehr geehrter Herr Bauer,\r\ndamit wir unsere gemeinsame Geschäftsverbindung fortführen können, benötigen wir als Sparkasse dringend Ihre aktive Zustimmung.',NULL),(15,'Privat/Phishing/Mailsystem/Impuls3','info@sparkasse.de','Mike Bauer','Informationsbogen zur Einlagensicherung','Sehr geehrter Herr Bauer,\r\nwir sind verpflichtet, Sie einmal im Jahr über die Sicherheit Ihrer Einlagen gemäß Einlagensicherungsgesetz zu informieren. Daher erhalten Sie heute von uns das gesetzlich vorgeschriebene Formular als jährliche Information zum Einlagensicherungsgesetz. Sie müssen nichts weiter tun.\r\n\r\nDas Sicherungssystem der Sparkassen-Finanzgruppe besteht seit Inkrafttreten des Einlagensicherungsgesetzes im Juli 2015 aus zwei Komponenten: Der gesetzlichen Einlagensicherung, die dem Einleger im Entschädigungsfall einen Erstattungsanspruch in Höhe von bis zu 100.000 EUR seiner Einlagen nach Maßgabe des Einlagensicherungsgesetz (EinSiG) gewährt, sowie der freiwilligen Institutssicherung, deren primäre Zielsetzung darauf gerichtet ist, einen Entschädigungsfall zu vermeiden und die ihm angehörenden Institute selbst zu schützen.\r\n\r\nWir bedanken uns für Ihre Aufmerksamkeit.\r\nViele Grüße, Ihre Sparkasse','','15:26:37.000000','Sehr geehrter Herr Bauer,\r\nwir sind verpflichtet, Sie einmal im Jahr über die Sicherheit Ihrer Einlagen gemäß Einlagensicherungsgesetz zu informieren.',NULL),(16,'GF/Einschleusen von Malware/Mailsystem/Email 1','IT-Bot@gmail.com','maria.arneo@arneo.com','Problem mit Passwort','Guten Morgen,\r\ndies ist eine automatisch generierte Nachricht aus Ihrer IT-Abteilung. Es hat verdächtige Unregelmäßigkeiten im Log-In Ihres Cloud-Zugangs gegeben. Bitte klicken Sie <a href=\"#\" style=\"color: #007bff; text-decoration: underline;\">hier</a>, um Ihr Passwort zu erneuern.\r\n\r\n\r\nMit freundlichen Grüßen\r\nIhre IT-Abtei