'static/images/AP_4.11_Impuls_1.png','Sie setzten sich in ein nettes Cafè. Das Passwort für das Cafè eigene WLAN ist auf die Getränkekarte gedruckt.'),(109,'SBA/Kompromittierung von Informationssystemen/Laptop/Impuls 2','static/images/AP_4.11_Impuls_2.png','Sie setzten sich in ein Cafè. Leider bietet das Cafè kein eigenes WLAN an. Der Barista weist Sie aber darauf hin, dass die örtlichen Stadtwerke ein öffentliches Netzwerk in diesem Bereich betreiben. Sie müssen via einer E-Mail-Adresse identifizieren und können anschließend für eine Stunde kostenlos das Internet nutzen.'),(110,'SBA/Kompromittierung von Informationssystemen/Laptop/Impuls 3','static/images/AP_4.11_Impuls_3.png','Sie setzten sich in ein Cafè. Auf der Getränkekarte steht, dass das Café kein WLAN hat. Sie sehen aber ein Netzwerk auf das Sie in diesem Bereich zugreifen können.'),(111,'SBA/Phishing/Social Media Systeme/Impuls 1','static/images/Impuls_1_fVdVdxS.png',''),(112,'SBA/Phishing/Social Media Systeme/Impuls 2','static/images/Impuls_2_CkN1pgz.png',''),(113,'SBA/Phishing/Social Media Systeme/Impuls 3','static/images/Impuls_3_279d2w0.png',''),(117,'SBA/Festplattenfehler/USB/Impuls 1','static/images/AP_4.2_Impuls_1.png',''),(118,'SBA/Festplattenfehler/USB/Impuls 2','static/images/AP_4.2_Impuls_2.png',''),(119,'SBA/Festplattenfehler/USB/Impuls 3','static/images/AP_4.2_Impuls_3.png',''),(129,'SBA/Kompromittierung von Informationssystemen oder Geräten/Telefon/Impuls 1','static/images/AP_4.12_Impuls_1.png',''),(130,'SBA/Kompromittierung von Informationssystemen oder Geräten/Telefon/Impuls 2','static/images/AP_4.12_Impuls_2.png',''),(131,'SBA/Kompromittierung von Informationssystemen oder Geräten/Telefon/Impuls 3','static/images/AP_4.12_Impuls_3.png',''),(156,'FK/Durchführung von nicht zielgerichteten Zero-Day-Angriffen/Buchhaltungssystem/Impuls 1','static/images/AP_3.2_Impuls_1.png',''),(157,'FK/Durchführung von nicht zielgerichteten Zero-Day-Angriffen/Buchhaltungssystem/Impuls 2','static/images/AP_3.2_I