INSERT INTO `job_profiles_jobprofile` VALUES (1,'Innendienst','Herr Müller ist Sachbearbeiter im Innendienst im Vertrieb & Marketing. Er arbeitet überwiegend am stationären PC und ihat viel telefonischen Kontakt zu Kunden.','•	Arbeit im Projekt „Smarte Ventilatoren“, in dem er in Kontakt mit verschiedenen Projektpartnern wie externen Dienstleister (u.a. TechNik GmbH) und Stammlieferanten steht \r\n•	Erstellung von Angeboten und Auftragsbestätigungen \r\n•	Verwaltung ausgewählter Stammkunden \r\n•	Er arbeitet überwiegend mit einem ERP-System, Büro-Software, E-Mail-Programm, Kollaborationssystem, Cloud-Speicher und verfügt über einen unternehmensweiten Instant-Messenging-Account',1),(3,'Geschäftsführer*in','Frau Arneo ist Geschäftsführerin der Arneo GmbH und trägt die Gesamtverantwortung für die strategische Ausrichtung und das operative Management des Unternehmens. Sie ist eine erfahrene Unternehmenslenkerin, die die Vision, die Ziele und die Strategie des Unternehmens definiert und umsetzt, um nachhaltiges Wachstum und Erfolg zu gewährleisten.','•	Festlegung von Unternehmensvision, -zielen und -strategie\r\n•	Gesamtverantwortung für operatives Management, inklusive Risikomanagement\r\n•	Führung und Motivation von Führungskräften und Mitarbeitern\r\n•	Überwachung der Unternehmensperformance und Innovationsmanagement',1),(4,'Führungskraft','Frau Blitz ist eine Führungskraft und trägt die Verantwortung für die strategische Planung, Organisation und Leitung von Teams oder Abteilungen innerhalb des Unternehmens. Sie ist eine erfahrene Entscheidungsträgerin, der in der Lage ist, Mitarbeiter*innen zu motivieren und zu führen, um Unternehmensziele zu erreichen.','•	Strategische Planung und Umsetzung von Unternehmenszielen\r\n•	Organisatorische Leitung von Teams oder Abteilungen\r\n•	Motivation, Führung und Entwicklung von Mitarbeitern\r\n•	Entscheidungsfindung und Risikomanagement\r\n•	Aufbau und Pflege von Beziehungen zu internen und externen Stakeholdern\r\n•	Budgetverantwortung und Ressourcenmanagement',1),(6,'IT-Admin','Herr Laimer ist IT-Admin. Er ist verantwortlich für die Administration, Überwachung und Wartung der IT-Infrastruktur des Unternehmens. Mit seinen umfassenden IT-Kenntnissen und Erfahrungen stellt er sicher, dass alle IT-Systeme und Netzwerke reibungslos funktionieren und den Sicherheitsrichtlinien entsprechen.','•	Administration, Überwachung und Wartung der IT-Infrastruktur\r\n•	Sicherstellung des reibungslosen Betriebs von IT-Systemen und Netzwerken\r\n•	Umsetzung von Sicherheitsrichtlinien und Schutz vor Cyberbedrohungen\r\n•	Unterstützung von Mitarbeitern bei IT-Fragen und Problemen',1),(7,'Außendienst','Herr Schmidt ist Sachbearbeiter im Außendienst im Vertrieb & Marketing. Er ist viel unterwegs und arbeitet auch häufiger im Ausland. Damit hat er ein hohes Risiko für Fremdeinfluss.','•	Arbeit im Projekt „Smarte Ventilatoren“, in dem er hier die neuen smarten Ventilatoren auf Messen präsentiert und Kunden dazu akquiriert\r\n•	Des Weiteren ist er für Betreuung und Beratung weiterer Stammkunden der Arneo GmbH zuständig und \r\n•	Analysiert dafür stets neue Verkaufsgebiete und Ermitteln neuer Absatzmöglichkeiten	\r\n•	Dabei arbeitet er überwiegend von unterwegs und besitzt einen Laptop, auf dem er die allgemeinen Büro-Anwendungenund ein E-Mail-Programm nutzt, sowie ein dienstliches Smartphone mit einem unternehmensweiten Instant-Messenging-Account',1);
/*!40000 ALTER TABLE `job_profiles_jobprofile` ENABLE KEYS */;
UNLOCK TABLES;

