INSERT INTO `threats_threatevent` VALUES (1,'Social Engineering','Beim Social Engineering nutzt der Täter den \"Faktor Mensch\" als vermeintlich schwächstes Glied der Sicherheitskette aus, um seine kriminelle Absicht zu verwirklichen.'),(2,'(Speer)-Phishing','Phishing ist der Versand gefälschter E-Mails, die Menschen dazu verleiten sollen, auf einen Betrug hereinzufallen. Phishing-Mails zielen häufig darauf ab, dass die Nutzer Finanzinformationen, Zugangsdaten oder andere sensible Daten preisgeben.'),(3,'Einschleusen bekannter Malware in interne Informationssysteme der Organisation','Der Angreifer nutzt gängige Übermittlungsmechanismen (z. B. E-Mail), um Malware in Informationssysteme von Unternehmen zu installieren/einzuschleusen.'),(4,'Kompromittierung von Informationssystemen','Hierbei nutzt der Angreifer gängige Übermittlungsmechanismen wie E-Mails, um Malware in die Informationssysteme von Unternehmen einzuführen und zu installieren.'),(5,'Web Defacement','Der Angreifer macht unautorisierte Änderungen an öffentlichen Webseiten.'),(6,'Man-in-the-Middle-Attack','Der Angreifer fängt Nachrichten des Opfers ab und sendet sie an ihr Ziel weiter, um so unbemerkt die Kommunikation zu kompromittieren.'),(7,'Verbreitung von Malware durch Bereitstellung von Wechselmedien','Der Angreifer verteilt Wechseldatenspeicher mit Malware, die das Opfer an eigenen Geräten nutzt.'),(10,'Durchführung von nicht zielgerichteten Zero-Day-Angriffen','Hierbei nutzt der Angreifer bislang unbekannte Schwachstellen in Informationssystemen aus, um Zugriff zu erlangen, ohne dass es ein spezifisches Ziel oder eine bestimmte Absicht gibt.'),(11,'Malware über downloadbare Software','Der Angreifer korrumpiert Freeware, Shareware oder kommerzielle IT-Produkte oder fügt Malware in diese ein. Der Angreifer zielt nicht spezifische Organisationen, und sucht nach Eintrittspunkten in interne organisatorische IS. Diese Bedrohung ist besonders für Handy-Applikationen relevant.'),(12,'Ausnutzen schlecht konfigurierter Systeme','Der Angreifer erlangt durch das Internet Zugang zu IS, die nicht für die Konnektivität zum Internet autorisiert sind oder organisatorische Vorgaben nicht erfüllen.'),(13,'Pharming-Angriff','Pharming ist eine Art von Phishing, bei der der Angreifer Nutzer zu bösartigen Seiten oder Proxy-Servern leitet, typescherweise mittels Domain Name System (DNS)-Poisoning.'),(14,'Shopping-/Service-Betrug','Der Angreifer verkauft nicht existierende Produkte oder Services.'),(15,'Falscher Umgang mit kritischen und/oder sensiblen Informationen','Diese Art von Bedrohung kann verschiedene Formen annehmen. Ein Mitarbeiter könnte versehentlich sensible Daten an falsche Empfänger senden, beispielsweise durch einen Fehler bei der Adressierung einer E-Mail oder durch die Auswahl eines falschen Empfängers in einer Datenbank. Eine andere Möglichkeit ist der mutwillige Diebstahl oder die Weitergabe vertraulicher Informationen durch einen Mitarbeiter, sei es aus finanziellen Motiven, Rache, Nachlässigkeit oder Unwissenheit über die Bedeutung der Daten.'),(16,'Schwachstellen in internen Informationssystemen (Buchhaltungssystem)','Schwachstellen in internen Informationssystemen (Buchhaltungssystem)'),(17,'Durchführung von Brute-Force-Anmeldeversuchen/Passworterratungsangriffen','Der Angreifer versucht, sich durch zufälliges oder systematisches Erraten von Passwörtern Zugang zu den Informationssystemen eines Unternehmens zu verschaffen, möglicherweise mit Hilfe von Programmen zum Knacken von Passwörtern.'),(18,'Durchführung von Data Scavenging-Angriffen in einer Cloud-Umgebung','Der Angreifer erlangt Daten, die von organisatorischen Prozessen in einer Cloud-Umgebung verwendet und dann gelöscht werden.'),(19,'Krypto-Diebstahl','tbd'),(20,'Angriffe auf persönliche Geräte kritischer Mitarbeiter*innen / Kompromittierung','Der Angreifer zielt auf wichtige Mitarbeiter des Unternehmens ab, indem er Malware auf deren persönliche Computern platziert. Ziel ist es, alle Fälle auszunutzen, in denen Mitarbeiter persönliche Informationssysteme oder -geräte für den Umgang mit kritischen/sensiblen Informationen nutzen.'),(21,'Durchführung von Network-Sniffing an freien Netzwerken','Ein Angreifer, der Zugang zu ungeschützten drahtgebundenen oder drahtlosen Datenkanälen hat, die zur Übertragung von Informationen verwendet werden, nutzt Netzwerk-Sniffing, um Komponenten, Ressourcen und Schutzmaßnahmen zu identifizieren.'),(22,'Installation von Allzweck-/persistenten/gezielten Sniffern in organisationsgesteuerten Informationssystemen oder Netzwerken','Der Angreifer installiert eine Sniffersoftware auf internen Informationssystemen oder Netzwerken der Organisation oder Netzwerke.'),(23,'Erfassen sensibler Informationen durch Netzwerk-Sniffing externer Netzwerke','Der Angreifer erhält Zugriff auf ungeschützte drahtgebundene oder drahtlose Datenkanäle, die Organisationen (oder Organisationspersonal) zur Übertragung von Informationen nutzen (z. B. Kioske, öffentliche drahtlose Netzwerke) und fängt diese Kommunikation ab.'),(24,'Kompromittierung von Informationssystem-Sitzungen des Datenverkehrs zwischen der Organisation und externen Entitäten','Der Angreifer übernimmt die Kontrolle über bereits bestehende, legitime Informationssystemsitzungen zwischen Organisationen und externen Stellen.'),(25,'Durchführung einfacher/verteilter/gezielter Denial-of-Service-Angriffe (DoS)','Ein Angreifer versucht, eine über das Internet zugängliche Ressource für die beabsichtigten Benutzer unzugänglich zu machen oder zu verhindern, dass die Ressource effizient oder überhaupt funktioniert, vorübergehend oder auf unbestimmte Zeit.'),(26,'Kompromittierung von Informationssystemen oder Geräten, die extern verwendet und wieder in das Unternehmen eingeschleust werden','Der Angreifer installiert Malware auf Unternehmenstelefone, während sich diese Geräte außerhalb des Unternehmens befinden, um anschließend das Unternehmen zu infizieren, wenn es wieder an Unternehmensnetzwerke angeschlossen wird.'),(27,'Ausnutzung von Multi-Tenancy in einer Cloud-Umgebung','tbd'),(28,'Autorisiertem Personal folgen, um Zutritt zu verschiedenen Einrichtungen zu erhalten (Tailgating)','tbd'),(29,'Ausnutzen bekannter Schwachstellen in mobilen Systemen (z. B. Laptops, PDAs, Smartphones)','Der Angreifer macht sich die Tatsache zunutze, dass sich Smartphones außerhalb des physischen Schutzes von Organisationen und des logischen Schutzes von Unternehmensfirewalls befinden, und kompromittiert die Smartphones auf der Grundlage bekannter Schwachstellen, um Informationen aus diesen Systemen zu sammeln.'),(30,'Ungesperrte Bildschirme','tbd'),(31,'(Weit verbreiteter) Festplattenfehler','Beschädigung des Speichers aufgrund eines Festplattenfehlers/Mehrere Festplattenfehler aufgrund der Alterung einer Reihe von Geräten, die alle zur gleichen Zeit vom gleichen Anbieter erworben wurden'),(32,'Spoofing','Der Angreifer erstellt Duplikate von legitimen Websites, wenn Benutzer eine gefälschte\r\nWebsite besuchen, kann diese Informationen sammeln oder Malware herunterladen.'),(33,'Angriffe im World Wide Web','tbd'),(34,'Weitergabe sensibler Informationen','Ein autorisierter Mitarbeiter kontaminiert irrtümlich ein Gerät, ein Informationssystem oder ein Netzwerk, indem Informationen mit einer Geheimhaltungsstufe/Sensibilität darauf ablegt oder daran gesendet werden, zu deren Handhabung es nicht autorisiert wurde. Die Informationen sind dem Zugriff Unbefugter ausgesetzt, und das Gerät, System oder Netzwerk ist nicht verfügbar, während der Schaden untersucht und behoben wird'),(35,'Bereitstellung von Malware','Der Angreifer nutzt komplexere Übermittlungsmechanismen als E-Mail (z. B. Internetverkehr, Instant Messaging, FTP), zum Übermitteln von (modifizierter) Malware, um sich so Zugang zu internen Informationssystemen des Unternehmens zu verschaffen.'),(36,'Einschleusen modifizierter Malware in interne Informationssysteme der Organisation','Der Angreifer nutzt komplexere Übermittlungsmechanismen als E-Mail (z. B. Internetverkehr, Instant Messaging, FTP), zum Übermitteln von (modifizierter) Malware, um sich so Zugang zu internen Informationssystemen des Unternehmens zu verschaffen.'),(37,'Bereitstellung gezielter Schadsoftware zur Kontrolle interner Systeme und zur Exfiltration von Daten','Der Angreifer installiert Malware, die speziell darauf ausgelegt ist, die Kontrolle über die internen Informationssysteme eines Unternehmens zu übernehmen, vertrauliche Informationen zu identifizieren und diese Informationen zu exfiltrieren.'),(38,'Umfassende Laufwerksfehler','Beschädigung bzw. Überalterung einer Reihe von Laufwerken, die alle zur gleichen Zeit vom gleichen Anbieter erworben wurden.'),(39,'Unzureichende Zugangskontrolle','Schleusen Sie autorisierte Mitarbeiter ein, um Zugang zu den Einrichtungen der Organisation zu erhalten.'),(41,'Falsche Berechtigungseinstellungen','Ein autorisierter Benutzer oder Administrator weist einem Benutzer fälschlicherweise außergewöhnliche Berechtigungen zu oder setzt die Berechtigungsanforderungen für eine Ressource zu niedrig an.');
