INSERT INTO `threats_threatsituation` VALUES (1,'Als Vorbereitung für das wöchentliche Jour Fixe des Projekts „Smarte Ventilatoren“ möchten Sie die neuen Lieferanten für die aktuell anstehende Beschaffung der Ventilator-Filter in die Projektskizze eintragen. In diesem Moment erreicht Sie eine Nachricht einer Ihnen unbekannten Person über das intenre Kollaborationssystem.',1,1,'2.11'),(2,'Sie sind seit kurzem in einem Social Network  aktiv und begeistert von den vielen Möglichkeiten. Besonders erfreut sind Sie darüber, mit bekannten und unbekannten Geschäftskontakten Verbindungen zu knüpfen und immer auf dem Laufenden zu bleiben. Während Ihrer Pause werfen Sie einen Blick in die Plattform und bemerken folgende Nachrichten. Dabei fällt Ihnen wieder ein, dass in den Medien von ausgefeilten Social-Engineering-Angriffen auf KMU berichtet wurde.',2,1,'2.12'),(3,'Kurz bevor Sie in die Mittagspause mit Ihrem Kollegen Mark Kistner aufbrechen wollen, schauen Sie nochmal nach Ihren Mails, da Sie auf ein Angebot von Ihrem Kollegen Lukas Maier warten.',3,1,'2.14'),(5,'Sie kommen nach der Mittagspause an Ihren Arbeitsplatz zurück und schauen in Ihr Mail-Programm, weil Sie auf die Plankosten des neuen Projekts „Smarte Ventilatoren“ von Ihrer Kollegin Anna Brand aus der Abteilung Buchhaltung & Finanzen warten. Dabei fällt Ihnen wieder ein, dass in den Medien von ausgefeilten Malware-Angriffen auf KMU berichtet wurde.',5,1,'2.15'),(16,'Eines Morgens kommt Ihre Assistentin aufgelöst auf Sie zu: \"Können Sie mal bitte mit mir in das Buchhaltungssystem schauen? Irgendwas stimmt mit den Rechnungen nicht!\" Sie zeigt Ihnen an ihrem Bildschirm das Buchhaltungssystem mit einer Beispielrechnung.',21,4,'3.1'),(17,'Sie beginnen Ihren Arbeitstag in der Arneo GmbH und prüfen als erstes Ihr E-Mail-Postfach, weil Sie auf Verkaufszahlen aus dem Projekt warten.',3,4,'3.7'),(26,'Heute Vormittag fand eine Besprechung des Projektteams „Smarte Ventilatoren“ statt. Am Ende der Besprechung eilen alle Beteiligten in die Kantine, da heute Currywurst Tag ist.',20,1,'2.8'),(28,'Ihr Kollege Mark Kistner aus der Produktionsabteilung kommt vorbei, um Sie zur Kaffeepause abzuholen. Sie wollen noch schnell eine E-Mail beantworten und bitten ihn, kurz zu warten. Während des Wartens erblickt Mark Kistner einen Ordner auf Ihrem Schreibtisch und fragt: „Kann ich da solange mal reinschauen?“',22,1,'2.5'),(32,'Sie beginnen Ihren Arbeitstag in der Arneo GmbH und loggen sich bei MS Teams ein, wie jeden Morgen. Sie stellen fest, dass Sie mehrere Nachrichten erhalten haben. Bitte schauen Sie sich die Anfragen genau an.',1,4,'3.11'),(34,'Im Zuge Ihrer monatlichen Routineaufgaben  möchten Sie sich per SSH / RDP in den Admin Account mehrerer Server einloggen. Nachdem Sie die Zugangsdaten eingegeben haben  erscheint eine Fehlernachricht mit der Meldung  dass die maximalen Versuche aufgebraucht wurden. Sie untersuchen die Logeinträge des Servers und sehen  dass die Anmeldeversuche außerhalb der Geschäftszeiten getätigt wurden. Daraufhin versuchen Sie sich in den Server der Abteilung Vertrieb & Marketing einzuloggen. Dieser zeigt die Nachricht  dass das Passwort falsch ist. Da Sie Ihre Passwörter aber mit einem Passwortmanager verwalten  sind Sie sicher  dass das Passwort korrekt ist.',25,6,'1.3'),(35,'Während Routineaufgaben fällt Ihnen in einer Log Datei auf,  dass außerhalb der Geschäftszeiten der Server der Buchhaltung viele Datenpakete an eine unbekannte IP-Adresse sendet. Durch Zufall finden Sie beim Inspizieren der laufenden Prozesse die dafür verantwortliche Datei. Die Untersuchung der Datei zeigt,  dass sie dafür ausgelegt ist  Daten auszuleiten. Ihre Recherche in einschlägigen Datenbanken für Schwachstellen ist erfolglos.',26,6,'1.4'),(39,'Sie betreten eines Morgens das Büro und schalten Ihren Rechner ein. Als Sie sich mit dem Server einer Datenbank verbinden, fällt Ihnen auf, dass die Daten, die über Nacht heruntergeladen wurden, nur teilweise und zum Teil korrupt auf dem Server abgelegt wurden.',30,6,'1.1'),(41,'Sie betreten morgens Ihr Büro und setzen sich an Ihren Laptop. Diesen haben Sie über Nacht laufen lassen, da Sie ein größeres Softwareprodukt herunterladen wollten. Als Sie den Laptop aufklappen und sich in Ihr Adminkonto einloggen möchten, sehen Sie folgende Nachricht:',32,6,'1.5'),(42,'Als Sie eine Webseite aufrufen, erhalten Sie den Hinweis, dass Ihr Browser veraltet ist. Der Hinweis enthält einen Link zur Downloadseite des Updates. Sie laden das Update herunter und installieren es. Als Sie in der Mittagspause Ihre Kolleg*innen fragen, ob diese schon das Update installiert haben, bekommen Sie die Antwort, dass sie keinen Hinweis erhalten haben.',33,6,'1.6'),(44,'Sie sind auf einer mehrtägigen Messe, um dort heute die neuen smarten Ventilatoren zu präsentieren und Kundenbeziehungen aufzubauen. Als Messebesucher erhielten Sie einen USB-Stick, auf dem das Messelogo bedruckt ist. Sie bemerken bei Betreten des Messegeländes, dass Sie den USB-Stick im Hotelzimmer vergessen haben, benötigen nun also dringend einen USB-Stick, um die Präsentationsfolien der Administration zu übergeben.',35,7,'4.8'),(45,'Sie sind etwas früher zu einem dienstlichen Termin angereist und suchen nun ein öffentliches WLAN-Netzwerk um noch dringende E-Mails zu beantworten.',36,7,'4.11'),(46,'Sie sind seit kurzem in einem Social Network aktiv und begeistert von den vielen Möglichkeiten. Besonders erfreut sind Sie darüber, mit bekannten und unbekannten Geschäftskontakten Verbindungen zu knüpfen und immer auf dem Laufenden zu bleiben. Während Ihrer Pause werfen Sie einen Blick in LinkedIn und bemerken folgende Nachrichten. Dabei fällt Ihnen wieder ein, dass in den Medien von ausgefeilten Social-Engineering-Angriffen auf KMU berichtet wurde.',37,7,'4.13'),(48,'Ihr Arbeitgeber stellt Ihnen USB Sticks für den täglichen Gebrauch zur Verfügung. Bei dem Verlust eines Gerätes können Sie einen baugleichen neuen anfordern. Sie benutzen den USB Stick in Ihrer täglichen Arbeit und als mobile Möglichkeit Sicherheitskopien anzulegen.',39,7,'4.2'),(52,'Sie sind Sachbearbeiter*in im Außendienst und befinden sich auf Dienstreise. Sie sind gerade am Flughafen um nach einem wichtigen Termin nach Hause zu fliegen. Sie erwarten aber noch einen wichtigen Anruf bezüglich des heutigen Meetings. Sie bemerken das der Akku Ihres Dienst Handys fast leer ist.',43,7,'4.12'),(56,'Morgens in der Rush Hour betreten Sie einen Bereich, der ausschließlich für autorisiertes Personal zugänglich ist und überwacht wird. Dabei fällt Ihnen etwas Außergewöhnliches auf.',47,1,'2.2'),(61,'Um den Budget-Plan zu erstellen, öffnen Sie die Buchhaltungssoftware und loggen sich wie üblich. Das Mitarbeiterkürzel SE, das abbildet, wer die  Buchungen vorgenommen hat, ist Ihnen bekannt.',49,4,'3.2'),(62,'Sie beginnen an diesem Morgen Ihren Arbeitstag in der Arneo GmbH und wollen sich an Ihrem Computer anmelden.',50,3,'5.2'),(63,'Sie befinden sich auf Dienstreise. Sie sind gerade am Flughafen, um nach einem wichtigen Termin nach Hause zu fliegen. Sie erwarten aber noch einen wichtigen Anruf bezüglich des heutigen Meetings. Sie bemerken, dass der Akku Ihres Diensthandys fast leer ist.',51,3,'5.6'),(65,'Sie öffnen am Dienstagmorgen Ihr E-Mail-Postfach und sehen folgende E-Mails:',34,3,'5.26'),(69,'Sie beginnen Ihren Arbeitstag in der Arneo GmbH und prüfen als erstes Ihr E-Mail-Postfach',3,3,'5.21'),(70,'Sie öffnen zu Arbeitsbeginn Ihre Cloud und stellen Folgendes fest:',56,3,'5.12'),(73,'Ein Schülerpraktikant kommt in Ihr Büro und zeigt Ihnen seinen Dienst-Laptop: \"Haben Sie mal kurz Zeit für mich? Ich soll die Bestellungen der letzten Monate zählen und daraus die Schwankungen ermitteln. Irgendwie bin ich jetzt aber nicht im Bestellsystem gelandet, wo muss ich denn hier klicken? Ich kenne mich noch nicht so gut aus, ich bin erst seit einer Woche da.\"',56,4,'3.14'),(74,'Im Rahmen des Projekts „Smarte Ventilatoren“ stehen Sie regelmäßig im Austausch mit Innendienstmitarbeiter Sven Müller, da er für die Verwaltung der Stammkunden zuständig ist. Sie prüfen unterwegs Ihr dienstliches Instant-Messenging Konto und stellen fest, dass Sie eine neue Nachricht erhalten haben.',38,7,'4.14');
