INSERT INTO `threats_threatvector` VALUES (1,1,1,'Der Angreifer benutzt Kollaborationssysteme (z. B. Asana, Teams) mit der Absicht, Personen innerhalb von Organisationen zu überreden oder auf andere Weise dazu zu bringen, kritische/sensible Informationen (z. B. personenbezogene Daten) preiszugeben.'),(2,2,1,'Der Angreifer benutzt Social-Media-Systeme (z.B. Facebook, Twitter) mit der Absicht, Personen innerhalb von Organisationen zu überreden oder auf andere Weise dazu zu bringen, kritische/sensible Informationen (z. B. personenbezogene Daten) preiszugeben.'),(3,3,2,'Der Angreifer fälscht E-Mails, um an vertrauliche Informationen wie Benutzernamen oder Kennwörter zu gelangen. Die Benutzer werden in der Regel auf scheinbar legitime Webseiten geleitet, während die eingegebenen Informationen in Wirklichkeit gestohlen werden. Der Angreifer setzt u. U. Phishing-Angriffe ein, die auf hochrangige Ziele abzielen (z. B. leitende Angestellte/Führungskräfte).'),(4,4,1,'Der Angreifer benutzt Instant Messenger (z.B. WhatsApp) mit der Absicht, Personen innerhalb von Organisationen zu überreden oder auf andere Weise dazu zu bringen, kritische/sensible Informationen (z. B. personenbezogene Daten) preiszugeben.'),(5,3,3,'Der Angreifer nutzt komplexere Übermittlungsmechanismen als E-Mail (z. B. Internetverkehr, Instant Messaging, FTP) zum Übermitteln von (modifizierter) Malware, um sich so Zugang zum internen Mailsystem des Unternehmens zu verschaffen.'),(6,5,3,'Der Angreifer platziert Wechseldatenträger (z. B. Flash-Laufwerke), auf denen Malware platziert wurde, an Orten inner- oder außerhalb der physischen Umgebung des Unternehmens, an denen die Mitarbeiter die Datenträger wahrscheinlich finden (z. B. in Konferenzen, an den Arbeitsplätzen der Mitarbeiter) und auf den Informationssystemen des Unternehmens verwenden.'),(7,6,4,'Sie sind etwas früher zu einem dienstlichen Termin angereist und suchen nun ein öffentliches WLAN-Netzwerk um noch dringende E-Mails zu beantworten.'),(8,2,5,'Der Angreifer erlangt Zugang zum Social-Media-Account des Opfers und nutzt ihn vor bösartige Zwecke.'),(10,5,7,'Der Angreifer verteilt USB-Sticks mit Malware an Orten, an denen sie das Opfer findet.'),(11,8,4,'Schwachstellen in internen Informationssystemen ermöglichen Angreifern Zugriff, zu dem System zu erlangen und Schaden anzurichten.'),(13,9,10,'Es werden Zero-Day Schwachstellen des Unternehmensserver von Angreifern ausgenutzt.'),(15,11,4,'Der Angreifer zielt auf wichtige Mitarbeiter des Unternehmens ab, indem er Malware auf deren persönliche Informationssysteme und Geräte (z. B. Laptops/Notebooks, persönliche digitale Assistenten, Smartphones) platziert.'),(18,14,13,'tbd'),(19,15,14,'tbd'),(20,16,15,'Diese Art von Bedrohung kann verschiedene Formen annehmen. Ein Mitarbeiter könnte versehentlich sensible Daten an falsche Empfänger senden, beispielsweise durch einen Fehler bei der Adressierung einer E-Mail oder durch die Auswahl eines falschen Empfängers in einer Datenbank. Eine andere Möglichkeit ist der mutwillige Diebstahl oder die Weitergabe vertraulicher Informationen durch einen Mitarbeiter, sei es aus finanziellen Motiven, Rache, Nachlässigkeit oder Unwissenheit über die Bedeutung der Daten.'),(21,8,16,'Der Bedrohungsvektor \"Ausnutzung von Schwachstellen in internen Informationssystemen\" bezieht sich auf Angriffe, die gezielt Schwächen in den internen IT-Systemen einer Organisation ausnutzen, insbesondere in solchen, die kritische Funktionen wie Buchhaltung ausführen. Angreifer könnten dabei Schwachstellen wie veraltete Software, unzureichend gesicherte Netzwerke oder menschliche Fehler ausnutzen.'),(22,16,34,'Der Bedrohungsvektor \"Weitergabe sensibler Informationen durch Mitarbeiter*innen\" umfasst das Risiko, dass interne Informationen durch das Handeln von Mitarbeitern unbeabsichtigt oder absichtlich außerhalb der Organisation geteilt werden. Dies kann durch direkte Weitergabe von Daten, unzureichend gesicherte Kommunikationskanäle oder durch den Verlust von Datenträgern und Endgeräten geschehen.'),(23,16,1,'tbd'),(24,8,35,'tbd'),(25,9,17,'Der Angreifer versucht, sich durch zufälliges oder systematisches Erraten von Passwörtern Zugang zu den Informationssystemen eines Unternehmens zu verschaffen, möglicherweise mit Hilfe von Programmen zum Knacken von Passwörtern.'),(26,9,10,'Hierbei nutzt der Angreifer bislang unbekannte Schwachstellen in Informationssystemen aus, um Zugriff zu erlangen, ohne dass es ein spezifisches Ziel oder eine bestimmte Absicht gibt.'),(27,3,36,'Der Angreifer nutzt komplexere Übermittlungsmechanismen als E-Mail (z. B. Internetverkehr, Instant Messaging, FTP), zum Übermitteln von (modifizierter) Malware, um sich so Zugang zu internen Informationssystemen des Unternehmens zu verschaffen.'),(28,3,37,'Der Angreifer installiert Malware, die speziell darauf ausgelegt ist, die Kontrolle über die internen Informationssysteme eines Unternehmens zu übernehmen, vertrauliche Informationen zu identifizieren und diese Informationen zu exfiltrieren.'),(29,18,10,'Hierbei nutzt der Angreifer bislang unbekannte Schwachstellen in Informationssystemen aus, um Zugriff zu erlangen, ohne dass es ein spezifisches Ziel oder eine bestimmte Absicht gibt.'),(30,9,38,'Beschädigung bzw. Überalterung einer Reihe von Laufwerken, die alle zur gleichen Zeit vom gleichen Anbieter erworben wurden.'),(31,9,25,'Ein Angreifer versucht, eine über das Internet zugängliche Ressource für die beabsichtigten Benutzer unzugänglich zu machen oder zu verhindern, dass die Ressource effizient oder überhaupt funktioniert, vorübergehend oder auf unbestimmte Zeit.'),(32,6,17,'Der Angreifer versucht, sich durch zufälliges oder systematisches Erraten von Passwörtern Zugang zu den Informationssystemen eines Unternehmens zu verschaffen, möglicherweise mit Hilfe von Programmen zum Knacken von Passwörtern.'),(33,19,36,'Der Angreifer nutzt komplexere Übermittlungsmechanismen als E-Mail (z. B. Internetverkehr, Instant Messaging, FTP), zum Übermitteln von (modifizierter) Malware, um sich so Zugang zu internen Informationssystemen des Unternehmens zu verschaffen.'),(34,3,3,'Der Angreifer nutzt gängige Übermittlungsmechanismen (z. B. E-Mail), um Malware in Informationssysteme von Unternehmen zu installieren/einzuschleusen.'),(35,5,7,'Der Angreifer verteilt Wechseldatenspeicher mit Malware, die das Opfer an eigenen Geräten nutzt.'),(36,6,4,'Der Angreifer installiert Malware auf Unternehmenslaptops, während sich diese Geräte außerhalb des Unternehmens befinden, um anschließend das Unternehmen zu infizieren, wenn es wieder an Unternehmensnetzwerke angeschlossen wird.'),(37,2,2,'Phishing ist der Versand gefälschter E-Mails, die Menschen dazu verleiten sollen, auf einen Betrug hereinzufallen. Phishing-Mails zielen häufig darauf ab, dass die Nutzer Finanzinformationen, Zugangsdaten oder andere sensible Daten preisgeben.'),(38,4,2,'Phishing ist der Versand gefälschter E-Mails, die Menschen dazu verleiten sollen, auf einen Betrug hereinzufallen. Phishing-Mails zielen häufig darauf ab, dass die Nutzer Finanzinformationen, Zugangsdaten oder andere sensible Daten preisgeben.'),(39,5,31,'Beschädigung des Speichers aufgrund eines Festplattenfehlers/Mehrere Festplattenfehler aufgrund der Alterung einer Reihe von Geräten, die alle zur gleichen Zeit vom gleichen Anbieter erworben wurden.'),(40,4,3,'Der Angreifer nutzt gängige Übermittlungsmechanismen (z. B. E-Mail), um Malware in Informationssysteme von Unternehmen zu installieren/einzuschleusen.'),(41,4,36,'Der Angreifer nutzt komplexere Übermittlungsmechanismen als E-Mail (z. B. Internetverkehr, Instant Messaging, FTP), zum Übermitteln von (modifizierter) Malware, um sich so Zugang zu internen Informationssystemen des Unternehmens zu verschaffen.'),(42,4,37,'Der Angreifer installiert Malware, die speziell darauf ausgelegt ist, die Kontrolle über die internen Informationssysteme eines Unternehmens zu übernehmen, vertrauliche Informationen zu identifizieren und diese Informationen zu exfiltrieren.'),(43,20,26,'Der Angreifer installiert Malware auf Unternehmenstelefone, während sich diese Geräte außerhalb des Unternehmens befinden, um anschließend das Unternehmen zu infizieren, wenn es wieder an Unternehmensnetzwerke angeschlossen wird.'),(44,4,1,'Beim Social Engineering nutzt der Täter den \"Faktor Mensch\" als vermeintlich schwächstes Glied der Sicherheitskette aus, um seine kriminelle Absicht zu verwirklichen.'),(45,3,1,'Beim Social Engineering nutzt der Täter den \"Faktor Mensch\" als vermeintlich schwächstes Glied der Sicherheitskette aus, um seine kriminelle Absicht zu verwirklichen.'),(46,2,1,'Beim Social Engineering nutzt der Täter den \"Faktor Mensch\" als vermeintlich schwächstes Glied der Sicherheitskette aus, um seine kriminelle Absicht zu verwirklichen.'),(47,16,39,'Schleusen Sie autorisierte Mitarbeiter ein, um Zugang zu den Einrichtungen der Organisation zu erhalten.'),(48,4,2,'Phishing ist der Versand gefälschter E-Mails, die Menschen dazu verleiten sollen, auf einen Betrug hereinzufallen. Phishing-Mails zielen häufig darauf ab, dass die Nutzer Finanzinformationen, Zugangsdaten oder andere sensible Daten preisgeben.'),(49,21,10,'Hierbei nutzt der Angreifer bislang unbekannte Schwachstellen in Informationssystemen aus, um Zugriff zu erlangen, ohne dass es ein spezifisches Ziel oder eine bestimmte Absicht gibt.'),(50,11,17,'Der Bedrohungsvektor \"Durchführung von Brute-Force-Anmeldeversuchen bzw. Passworterratraten\" bezieht sich auf Angriffe, die darauf abzielen, durch systematisches Ausprobieren aller möglichen Passwörter (Brute-Force) oder durch geschicktes Raten basierend auf gängigen Passwörtern oder leicht zugänglichen Informationen des Benutzers (Passworterraten) Zugang zu einem Computer zu erlangen.'),(51,20,4,'Der Bedrohungsvektor \"Kompromittierung von Informationssystemen, insbesondere von Telefonen\", bezieht sich auf Angriffe, die darauf abzielen, Zugang zu Mobiltelefonen zu erlangen, um sensible Informationen zu stehlen oder zu manipulieren.'),(53,22,29,'tbd'),(55,6,26,'Der Angreifer installiert Malware auf Laptops, während sich dieses Gerät außerhalb des Unternehmens befindet, um anschließend das Unternehmen zu infizieren, wenn es wieder angeschlossen ist.'),(56,16,41,'Ein autorisierter Benutzer oder Administrator weist einem Benutzer fälschlicherweise außergewöhnliche Berechtigungen zu.'),(57,14,32,'Der Angreifer erstellt Duplikate von einer Online-Banking-Seite. Wenn Benutzer die Seite besuchen, kann diese Informationen sammeln oder Malware herunterladen.');
